import React, {useState, useEffect} from 'react'

const Characters = () => {


    useEffect(() => {
        fetch("https://www.breakingbadapi.com/api/characters")
        .then(res => res.json())

    })

    return (
        <div>
            <h1>Character Page</h1>
        </div>
    )
}

export default Characters
